import React, { useState } from "react";
import { Grid, Tab, Tabs, Paper } from "@mui/material";

const Header = () => {
    const [value, setValue] = React.useState('one');

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };
    return (
        <Grid container spacing={1}>
            <Grid item xs={12}>
            <Paper style={{ backgroundColor: '#262626', padding: '20px' }}>
                <Tabs
                    value={value}
                    onChange={handleChange}
                    textColor="inherit"
                    sx={{ 
                        "& .MuiTabs-indicator": { backgroundColor: "white" } 
                    }}
                    indicatorColor="primary"
                    >
                        <Tab value='one' label='First' sx={{ color: 'white' }} />
                        <Tab value='two' label='Second' sx={{ color: 'white' }} />
                        <Tab value='three'label='Third' sx={{ color: 'white' }} />
                </Tabs>
            </Paper>
            </Grid>
        </Grid>
    )
}

export default Header;
